      function initialize() {
        var mapOptions = {
          center: { lat: 1.3146631, lng: 103.8454093},
          zoom: 11
        };
        map = new google.maps.Map(document.getElementById('map-canvas'),
            mapOptions);

        var geocoder = new google.maps.Geocoder();
        var infoWindow = new google.maps.InfoWindow();
        clinics.forEach (function(clinic) {
          var marker = new google.maps.Marker({
              map: map,
              position: clinic.location,
              title: clinic.CLINICNAME
          });
          google.maps.event.addListener(marker, 'click', function() {
            infoWindow.close();
            infoWindow = new google.maps.InfoWindow();
            infoWindow.setContent(
              '<h3>'+clinic.CLINICNAME+'</h3>'+
              '<p>'+clinic.BLK+', '+clinic.ROADNAME+', '+clinic.UNITNUMBER+', '+clinic.BUILDINGNAME+', '+clinic.POSTAL+'</&nbsp;>'+
              '<p>Tel: '+clinic.TEL+', Fax: '+clinic.FAX+'</p>'+
              '<p>Mon-Fri: '+clinic.MONFRI+'</p>'+
              '<p>Sat: '+clinic.SAT+'</p>'+
              '<p>Sun: '+clinic.SUN+'</p>'+
              '<p>'+clinic.REMARKS+'</p>'
              );
            infoWindow.open(map, marker);
          });
        });
      }
      google.maps.event.addDomListener(window, 'load', initialize);
    </script>
